import React from "react";
import {
  SafeAreaView,
  View,
  Image,
  Text,
  TouchableOpacity,
  Dimensions,
} from "react-native";
import {
  JacquesFrancoisText,
  styles,
} from "./DialogueProfileMainUserPageStyles";
import { Entypo, Fontisto } from "@expo/vector-icons";

const mainAvatarPath: string = "./DialogueProfileAssets/mainAvatar.jpg";
var profileName: string = "Денис";
var lastTimeOnlineString: string = "Був у мережі давно";

if (profileName.length > 10) {
  profileName = profileName.slice(0, 10) + "...";
}

const DialogueProfileMainUserPage = () => {
  return (
    <View style={styles.mainContainer}>
      <View style={styles.topToolBar}>
        <Text style={styles.profileTitle}>{profileName}</Text>
        <Text style={styles.onlineStatusTitle}>{lastTimeOnlineString}</Text>
        <TouchableOpacity
          style={styles.goBackFromProfileButton}
          onPress={() => {
            alert("Going back...");
          }}
        >
          <Entypo name="chevron-thin-left" size={32} color="black" />
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.searchMessagesButton}
          onPress={() => {
            alert("Searching...");
          }}
        >
          <Fontisto name="search" size={26} color="black" />
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.elseFeaturesButton}
          onPress={() => {
            alert("Else features...");
          }}
        >
          <Entypo name="dots-three-horizontal" size={24} color="black" />
        </TouchableOpacity>
      </View>
      {/*<Image
        style={styles.mainAvatarImage}
        source={require(mainAvatarPath)}
        ></Image>*/}
    </View>
  );
};

export default DialogueProfileMainUserPage;
